INSERT INTO `email_templates` (`id`, `name`, `email_subject`, `email_body`, `created_at`, `updated_at`, `deleted_at`, `status`) VALUES
(1, 'job_post_notify', 'Congratulations! You have posted a new job', '<p>Hi {{RO}},</p><p>Congratulations! You have successfully posted a job {{jobName}} for service {{serviceName}}.<p><p>Thank you</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(2, 'applied_job', 'Job Applicant (Provider)', '<h2>{{title}}</h2><p>{{body}}</p><p>{{thankyou}}</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(3, 'approved_decline_provider', 'Account has been {{status}}', '<p>Hi {{name}},</p><p>Your account has been {{status}}.</p><p>Thank you</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(4, 'Job_Offer_Accepted_from_RO', 'Job Offer Status', '<p>Hi {{restaurant}},<p>The Job offer {{job_id}}, extended to tech {{tech_name}} has been accepted by the technician.</p><p>Thank you</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(5, 'Job_Offer_Rejected_from_RO', 'Job Offer Status', '<p>Hi {{restaurant}},</p><p>The Job offer {{job_id}}, extended to tech {{tech_name}} has been declined by the technician.</p><p>Thank you</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(6, 'thankyou_email_after_verify_account', '2Top Tech email verification confirmation', '<p>Congratulations {{name}} and Welcome!<p><p>Thankyou for verifying your email address. To complete your profile, please login to your account.</p><p>Make it a great day!</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(7, 'send_offer_to_provider', 'New job offer from {{RO}}', '<p>Hi {{name}},<p><p>The Job ({{job}}) you had applied for, has been accepted and the Restaurant has sent an offer.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(8, 'provider_applying_job', 'New Job Application', '<p>Hi {{ro}},<p><p>You have a new Technician! {{technician}} has applied for Job {{job}} posted by you.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(9, 'part_request_email', 'Part Request', '<p>Hi {{admin}},<p><p>Technician {{name}} has requested for a part.</p><p> Part Request detail </p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(10, 'bank_detail_updated', 'Bank Detail Updated', '<p>Hi {{admin}},<p><p>Technician {{name}} has updated bank details.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(11, 'new_job_post', 'New Job Post', '<p>Hi {{providerName}},<p><p>A new job post has been created which matches your skills ( {{serviceName}} ).</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(12, 'job_post_update_by_ro', 'Job Updated by RO', '<p>Hi {{providerName}},<p><p>The job post has been modified by the Restaurant.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(13, 'referral_invitation', 'Inviting referrals for 2Top Tech', '<p>Hello {{referringToName}},</p><p>{{restaurantOwnerName}} has sent invitation for 2Top tech app.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(14, 'job_rating', 'New Job rating for {{RO}}', '<p>Hello Admin,</p><p>The technician has given {{rate}} star rating to the company {{RO}}.</p><p>Thankyou</p>', '2022-12-01 05:56:15', '2022-12-01 05:56:15', NULL, 1),
(15, 'Job_completion_approve_and_payment', 'New Job rating for {{RO}}', '<p>Hello Admin,</p><p>The technician has given {{rate}} star rating for the job {{RO}}.</p><p>Thankyou</p>', '2023-01-05 13:45:48', NULL, NULL, 1),
(16, 'Job_completion_booking_invoice_provider', 'Job Completion Booking Invoice', '<p>Hello Admin, {{RO}}</p><p>The technician {{technicianName}} has completed and generated the Invoice for Job Service {{serviceName}}.</p><p>Thankyou</p>', '2023-01-09 12:20:31', '2023-01-09 12:20:31', NULL, 1),
(17, 'Cancellation_job_email_notification_to_technician', '{{company_name}} cancelled booking', '<p>Hi {{provider_name}},<p><p>{{company_name}} cancelled booking.</p><p>You will be paid 1 hour for booking cancellation.</p><p>Thank you.</p>', NULL, NULL, NULL, 1),
(18, 'Cancellation_job_email_notification_to_restaurant', 'Your booking with {{provider_name}} is cancelled.', '<p>Hi {{company_name}},<p><p>Your booking with {{provider_name}} is cancelled.</p><p>Thank you.</p>', NULL, NULL, NULL, 1),
(19, 'job_creating_charge_failed', 'Creating Charge Failed.', '<p>Hello {{restaurant}},</p><p>Creating charge process has failed.</p><p>Thankyou</p>', NULL, NULL, NULL, 1);
